pragma solidity ^0.4.18;
import "../node_modules/zeppelin-solidity/contracts/token/ERC20/MintableToken.sol";

/**
 * @title Blockchainlabs token
 * @dev follows ERC20 Token standards, with mintings properties
 * @dev Issue: * https://github.com/OpenZeppelin/zeppelin-solidity/issues/120
 * Based on code by TokenMarketNet: https://github.com/TokenMarketNet/ico/blob/master/contracts/MintableToken.sol
 */
contract BlockchainLabsToken is MintableToken {

  string public constant NAME = "BlockchainLabsToken";
  string public constant SYMBOL = "BLC";
  uint8 public constant DECIMALS = 18;

  uint public totalSupply_ = 1000000;

  mapping(address => uint) public balances;

  function BlockchainLabsToken() public {
    balances[msg.sender] = totalSupply_;
  }

  function totalSupply() public view returns(uint) {
    return totalSupply_;
  }

}

